import React from 'react';
import ReactDOM from 'react-dom'

function menu() {
    return (
        <div className="menu">
            <a href="#">main</a>
            <a href="#">next</a>
            <a href="#">prev</a>
            <a href="#">item</a>
            <a href="#">list</a>
        </div>
    );
}
ReactDOM.render(menu, document.getElementById('App'));
